import React from 'react';
import { Link } from 'react-router-dom';
import { FaUser } from 'react-icons/fa';

const Header = () => {
  return (
    <div className='flex gap-10 justify-center items-center bg-slate-600 text-white fixed top-0 w-full z-10'>
      <div className='text-3xl font-bold '>
        <h1>E-Commerce Project</h1>
      </div>
      <div className='flex space-x-4 p-4'>
        <button className='hover:bg-slate-700 px-3 py-1 rounded'>About</button>
        <button className='hover:bg-slate-700 px-3 py-1 rounded'>Program List</button>
        <button className='hover:bg-slate-700 px-3 py-1 rounded'>Community</button>
        <button className='hover:bg-slate-700 px-3 py-1 rounded'>Contact</button>
      </div>
      <div className="flex items-center justify-center space-x-4 p-4">
      <Link to="/login" className="bg-blue-500 text-white px-5 py-2 rounded-md flex items-center space-x-2 hover:bg-blue-600 transition duration-300">
        <FaUser className="text-white w-5 h-5" />
        <span>Login</span>
      </Link>

      {/* Sign Up Button */}
      <Link to="/signup" className="bg-green-500 text-white px-5 py-2 rounded-md hover:bg-green-600 transition duration-300">
        Sign Up
      </Link>
    </div>
    </div>
  );
}

export default Header;
